import React, { useState } from "react";
import CustomButton from "../CustomButton";
import { SignUpForUser } from "../../services/service";

const Login = () => {
  const [showSignup, setShowSignup] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [signUpPassword, setSignUpPassword] = useState("");

  const handleSignUp = () => {
    let payload = {
      firstName: firstName,
      lastName: lastName,
      email: email,
      password: signUpPassword,
    };

    SignUpForUser(payload).then((resp) => {
        if(resp?.statusCode === 200){
            setShowSignup(false)
        }
        else{
            setShowSignup(true)
        }
    });
  };

  const handleLogin = () => {
    let payload = {
      username: username,
      password: password,
    };
    console.log("firstsda", payload);
  };
  return (
    <div className="flex flex-row max-h-full mx-4 my-3">
      {showSignup ? (
        <div className="flex flex-col w-1/2 items-center bg-white py-28 rounded-2xl">
          <span className="text-4xl font-bold text-indigo pb-6">Signup</span>
          <div className="flex flex-col gap-5 my-4 w-full ">
            <input
              type="text"
              placeholder="First Name"
              value={firstName}
              onChange={(e) => {
                setFirstName(e.target.value);
              }}
              className=" px-3  py-4 rounded-lg mx-5 border border-gray-200  focus:outline-indigo"
            />
            <input
              type="text"
              placeholder="Last Name"
              value={lastName}
              onChange={(e) => {
                setLastName(e.target.value);
              }}
              className=" px-3  py-4 rounded-lg mx-5 border border-gray-200  focus:outline-indigo"
            />
            <input
              type="email"
              placeholder="Email Address"
              value={email}
              onChange={(e) => {
                setEmail(e.target.value);
              }}
              className=" px-3  py-4 rounded-lg mx-5 border border-gray-200  focus:outline-indigo"
            />
            <input
              type="password"
              placeholder="Password"
              value={signUpPassword}
              onChange={(e) => {
                setSignUpPassword(e.target.value);
              }}
              className=" px-3 mx-5 py-4 rounded-lg border border-gray-200  focus:outline-indigo"
            />
          </div>
          <div className="mt-5">
            <CustomButton
              title="Sign Up"
              backgroundColor="bg-indigo"
              textColor="text-white"
              borderClass={`border-indigo`}
              PaddingX="px-40"
              myOnClick={handleSignUp}
            />
          </div>
        </div>
      ) : (
        <div className="flex flex-col w-1/2  items-center bg-white py-[12%]">
          <span className="text-4xl font-bold text-indigo">Login</span>
          <div className="flex flex-col gap-5 my-4 w-full ">
            <input
              type="email"
              placeholder="Email Address"
              value={username}
              onChange={(e) => {
                setUsername(e.target.value);
              }}
              className=" px-3  py-4 rounded-lg mx-5 border border-gray-200  focus:outline-indigo"
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => {
                setPassword(e.target.value);
              }}
              className=" px-3 mx-5 py-4 rounded-lg border border-gray-200  focus:outline-indigo"
            />
          </div>
          <div className="flex flex-row justify-between w-full px-5 text-indigo ">
            <div></div>
            <div className="cursor-pointer text-sm">Forgot Password?</div>
          </div>
          <div className="mt-5">
            <CustomButton
              title="Submit"
              backgroundColor="bg-indigo"
              textColor="text-white"
              borderClass={`border-indigo`}
              PaddingX="px-40"
              myOnClick={handleLogin}
            />
          </div>
          <div className="text-sm mt-5">
            Dont Have an Account?
            <span
              className="text-indigo cursor-pointer"
              onClick={() => setShowSignup(true)}
            >
              Create An Account
            </span>
          </div>
        </div>
      )}
      <div className="w-1/2">
        <div
          className="w-full h-[100%] bg-cover bg-center"
          style={{ backgroundImage: "url('/images/login.jpg')" }}
        ></div>
      </div>
    </div>
  );
};

Login.prototype = {};

export default Login;
